'''《食之契约》'''是台湾英旗互动娱乐有限公司开发的一款的游戏。

== 简介 ==

最初，这个世界还仅仅是依托于地球上的人们所渴望的希望之物。但也正是因此才得以诞生出另一位面的至高神明——肇始之神。

｢命运是无法逃脱的，不管是我，还是你。｣

｢轻易地碰触我的话，可是会被灼伤的。｣

｢我的人可不能有那么纤弱的外在，嗯，先从酒量开始锻炼吧。｣

御侍们，一起与食灵携手前进吧！

